@shpeterson @Dzpatriotdzz @G_Amundarain @thatdayin1992 It's called 'bleeding them dry.'

Ukraine is taking cities back but at an unsustainable cost. And each 'victory' is putting them further into a resource hole which will bite them in the long term.

It's like blowing $20 bucks now in a way it costs you $2000 down the line.
